import React from "react";

const CustomRadio = ({ label, ...restProps }) => {
  return (
    <div>
      <label htmlFor="shows-search">
        Shows
        <input
          id="shows-search"
          type="radio"
          value="shows"
          checked={isShowsSearch}
          onChange={onRadioChange}
        ></input>
      </label>
    </div>
  );
};

export default CustomRadio;
